import React, {Component, Fragment} from 'react';
// import moduleName from 'material-ui/styles/';
import MuiThemeProvider from '@material-ui/core/styles/MuiThemeProvider';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import classes from './FormInfinitive.module.css';

class FormInfinitive extends Component {
    continue = (e) => {
        e.preventDefault();
        this.props.nextStep();
    };

    render() {
        const {values, handleChange} = this.props;
        return (
            <MuiThemeProvider>
                <Fragment>
                    <div className={classes.InfinitiveBox}>
                        <p><i>Infinitive</i></p>
                        <div className={classes.Columns}>
                            <TextField
                                placeholder='infinitive'
                                label="infinitive"
                                value={values.infinitive}
                                onChange={handleChange('infinitive')}
                                defaultValue={values.infinitive}
                            />
                        </div>

                    </div>
                    <div className={classes.ImperativeBox}>
                        <p><i>Imperative</i></p>
                        <div className={classes.Columns}>
                            <div className={classes.LeftColumn}>
                                <div className={classes.GenderSign}>

                                </div>

                                <div>
                                    <TextField
                                        placeholder='imperative'
                                        label="imperative for men"
                                        value={values.infinitive}
                                        onChange={handleChange('infinitive')}
                                        defaultValue={values.infinitive}
                                    />
                                </div>

                                <div>
                                    <TextField
                                        placeholder='infinitive'
                                        label="infinitive"
                                        value={values.infinitive}
                                        onChange={handleChange('infinitive')}
                                        defaultValue={values.infinitive}
                                    />
                                </div>

                            </div>
                            <div className={classes.RightColumn}>
                                <div className={classes.GenderSign}>

                                </div>

                                <div>
                                    <TextField
                                        placeholder='imperative'
                                        label="imperative for men"
                                        value={values.infinitive}
                                        onChange={handleChange('infinitive')}
                                        defaultValue={values.infinitive}
                                    />
                                </div>

                                <div>
                                    <TextField
                                        placeholder='infinitive'
                                        label="infinitive"
                                        value={values.infinitive}
                                        onChange={handleChange('infinitive')}
                                        defaultValue={values.infinitive}
                                    />
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className={classes.PresentBox}>
                        <p><i>Present Tense</i></p>
                        <div className={classes.Columns}>
                            <div className={classes.LeftColumn}>
                                <div className={classes.GenderSign}>

                                </div>

                                <div>
                                    <TextField
                                        placeholder='imperative'
                                        label="imperative for men"
                                        value={values.infinitive}
                                        onChange={handleChange('infinitive')}
                                        defaultValue={values.infinitive}
                                    />
                                </div>

                                <div>
                                    <TextField
                                        placeholder='infinitive'
                                        label="infinitive"
                                        value={values.infinitive}
                                        onChange={handleChange('infinitive')}
                                        defaultValue={values.infinitive}
                                    />
                                </div>

                            </div>
                            <div className={classes.RightColumn}>
                                <div className={classes.GenderSign}>

                                </div>

                                <div>
                                    <TextField
                                        placeholder='imperative'
                                        label="imperative for men"
                                        value={values.infinitive}
                                        onChange={handleChange('infinitive')}
                                        defaultValue={values.infinitive}
                                    />
                                </div>

                                <div>
                                    <TextField
                                        placeholder='infinitive'
                                        label="infinitive"
                                        value={values.infinitive}
                                        onChange={handleChange('infinitive')}
                                        defaultValue={values.infinitive}
                                    />
                                </div>
                            </div>
                        </div>
                    </div>


                    <div className={classes.ButtonSection}><Button
                        variant="contained"
                        color="primary"
                        onClick={this.continue}>Continue</Button></div>
                </Fragment>
            </MuiThemeProvider>
        );
    }
}

export default FormInfinitive;
